import Navbar from './components/Navbar/Navbar';
import { Router, Routers, Route } from "react-router-dom";

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Routers>
          <Route path='/' element={Home} />
        </Routers>
      </Router>
    </>
  );

  function Home() {
    return
    <h1>Home Page</h1>
  }

}

export default App;
